data.text:
@64Pierrick Hi, 

We are unfortunately unable to assist with compensation claims over Twitter however you can send a claim to our Customer Care department at https://t.co/kDAXvXUXIa and they will be able to have a look at your case.

Best regards / Sanna

@XAnna_RichardsX Hello, please contact us on live chat https://t.co/b3QIqPk7bj with your booking details and we can help you take a look at the refund status.

Best regards,
Anton.

@foxpaul142 Hi, please contact us on live-chat https://t.co/b3QIqPk7bj with your case ID and we can send a reminder to Customer Care for you.

Best regards,
Anton.

@ogse90 Hi, please contact us on live chat or phone with your booking details and we can help you check what possibilities there are for refund https://t.co/b3QIqPk7bj

Best regards,
Anton.

@Emchgi Hello!
We are aware of this and there are different factors that can be the reason to this error message. For assistance with your rebooking, please call our sales and service department. You can find your local SAS phonenumber here: https://t.co/b3QIqPk7bj

Thank you / Emilia

@TheYousufKhan Hi, I'm sorry to hear that your flight was delayed. But we are not able to assist with compensation claims here over Twitter, if you have made a claim with our Customer care they will contact you on email as soon as possible.

Best regards,
Anton

@alfonsaaberg100 Okej så bra att det ordnade sig för er. Ha en trevlig helg.

Med vänlig hälsning,
Anton.

@Dzzulie Hej, om du blivit ombokad till nya avgångar som inte är möjlig att genomföra så verkar det dessvärre ha blivit något fel. Vänligen ring oss på tel +47 21 896 400 så kan vi hjälpa dig att kolla på detta.

Med vänlig hälsning,
Anton.

@alfonsaaberg100 Hej! Vad tråkigt att höra att ni blivit ofrivilligt ombokade. Vänligen kontakta oss på tel +45 70 102 000 så kan vi hjälpa er att kolla på andra alternativ att omboka till.

Med vänlig hälsning,
Anton.

@AdamVShattock Hej! Vi beklagar om du inte fått ersättning för skadan på ert bagage än. Vänligen kontakta oss på Facebook Messenger eller livechatt https://t.co/z4gOZAAJQJ med ert Case ID på 7 siffror så kan vi sända en påminnelse till vår Customer Care.

Med vänlig hälsning,
Anton.

@MxCharty Hi, we apologize for the longer than usual wait times on the phone. If you still need help with rebooking please call us again, we will take your call as soon as possible. Our phone numbers are listed at https://t.co/b3QIqPk7bj

Best regards,
Anton.

@Ruff_Tone Hello! 
We have no customer service via email. You will find our contact information and our live chat here: https://t.co/b3QIqPk7bj

Thank you for contacting us, regards Anja!

@abragd Hej! Du är välkommen att ansöka om ersättning för den extra utgiften via vår customer care-avdelning. Du kan kontakta dem här via denna länk:
https://t.co/OzrIxYNv63 välj "General Complaint or compliment".

Tack för att du kontaktar oss, hälsningar Anja!

@noerstad Hej! 

Jag beklagar om er resa vart påverkad. Om du vill skicka in ett klagomål eller synpunkter så kan du göra det via denna länk: https://t.co/BTF660MMR4

//Vänlig hälsning, Dennis.

@henrisluis Hi! 

I'm happy to see that you had a good time on our flight, and thank you for the compliment! I hope you have a great day! 

//Best regards, Dennis.

@HelenSiverstol Hej! 

Jag beklagar att du har fått vänta så länge, dessvärre kan jag inte se varför agenten tog sådan lång tid men det kan ha varit något oväntat kring bokningen. Jag hoppas det löste sig för dig.

//Vänlig hälsning, Dennis.

@KlaudiaSwiat Hi! 

I'm sorry if your flight was affected, we sadly have a long queue right now but our agents are working on it as fast as possible. I saw you booking and i can see that you have already cancelled it, so you will receive the refund as soon as possible. 

/best regards, Dennis.

@woodsarahc Hi! 

Fully trained service animals may fly in the cabin at no charge if they meet the requirements. You can see them at this link: https://t.co/HzncNcH84U
But  from 11JAN21 the US law no longer require airlines to accept emotional support animals.

//Best regards, Dennis.

@timrifts Hi! 

I'm sorry that you received that error message, but i'm happy we were able to help you fix it.

//Best regards, Dennis.

@KatriTuomela Det geopolitiska området för Skandinavien innefattar endast Sverige, Norge och Danmark, så Finland räknas egentligen inte in som ett skandinaviskt land. Vi ber också verkligen om ursäkt för hur ni blev bemött av personalen där vid ombordstigningen. 

Med vänliga hälsningar,
Jenny

@k_harx Yes this form is usually used after a trip is made. In this case you need to use the category "general complaint" where you unbox "yes-this claim is connected to a flight" and you will be able to describe your situation in the free text.

Warm regards,
Jenny

@KatriTuomela Hej! Ja det stämmer. Om man reser utanför skandinavien är munkydd ett krav på vår flyg.

Med vänliga hälningar,
Jenny

@jock2209 Regarding any delayed, lost or damaged baggage, a report must be done to our baggage service staff as we do not handle baggage reports through our customer service.

Warm regards,
Jenny

@AlexanderRadahl We are very sorry for the waiting time regarding your case. In this case you will need to wait for them to answer you back by email, as our customer care have have a longer handling time during the pandemic.

Warm regards,
Jenny

@Daanpons If you have 23 kg checked in luggage in your ticket you can only bring one bag with the max weight of 23 kg. Otherwise you will need to buy extra luggage yes if you want a separate bag for the longboard.

Warm regards,
Jenny

@Daanpons You can check in the longboard as it is but unfortunatly if there are any outer damage to the board we will not compensate for this. So the best would be to have a bag or other protection for the board.

Warm regards,
Jenny

@AlexanderRadahl We are very sorry for this inconvenience. Have you made a damaged bag report to our baggage service?

Warm regards,
Jenny

@lisawthefringe Hello! If the number is not reachable, please contact the airport's general number and ask to be directed to the baggage service. If you wish to leave a complaint, please use the form here: https://t.co/4OXcDkyQSk

Warm regards,
Jenny

@Daanpons Hello! It is totally fine to bring it. Though you will have to pack it inside your checked in bag.

Warm reagrds,
Jenny

@1DVEVO Hello! You earn points from every flight separatly so if you travel AMS-CPH-ARN you will earn for 2 flights.

Warm regards,
Jenny

@k_harx Absolutly, you can cancel the ticket and book a new one, though we will only refund due to your ticket rules. For further help and information please contact our customer service. Our contact information can be found here: https://t.co/b3QIqPk7bj

Warm regards,
Jenny

@katehodgson8 We are very sorry for the inconvenience. In this case I would recommend that you read through the delayed luggage information here: https://t.co/KQdOdrH9TM. Also when we have found your luggage you will be contacted regarding delivery.

Warm regards,
Jenny

@jock2209 In this case I recommend that you call the airport's general number for assist. Otherwise you will need to bring the bag back to the airport and show it to staff on site.

Warm regards,
Jenny

@Andremmmmmm Hello! We are very sorry for this. For assist with the voucher please contact our customer service by phone or livechat. Our contact information can be found here: https://t.co/b3QIqPk7bj

Warm regards,
Jenny

@webbie13 Hello! In this case I would recommend that you contact our customer service by livechat or phone so we can help you to add the baggage. Our contact information can be found here: https://t.co/b3QIqPk7bj

Warm regards,
Jenny

@Wandblade Hello! We are very sorry for the inconvenience. You need to go to any of our ticket desks at the airport so we can help you rebook to the next possible flight. Or you need to call us for support. Numbers can be found here: https://t.co/b3QIqPk7bj

Warm regards,
Jenny

@k_harx Hello! We are very sorry, but unfortunatly it is not possible to ask for a refund of already prepaid add ons. If you wish to send us a complaint or apply for a compensation, you can do so here: https://t.co/4OXcDkyQSk

Warm regards,
Jenny

@katehodgson8 Hello! We are very sorry for your lost luggage. Please make a missing bag report here: https://t.co/7iWu2adlLd or by calling our baggage service. Phone numbers can be found here: https://t.co/ZV9bTO3uo2 

Warm regards,
Jenny

@jock2209 Hello! We are very sorry for the damaged bag. If you have already left the airport I recommend that you call our baggage service on Heathrow by phone +44 344 3754250 and they will help you with a damaged bag report. 

Warm regards,
Jenny

@gillygal Hello! We are very sorry for the inconvenience. In this case I recommend that you apply for a compensation for the extra baggage fee through our feedback form which can be found here: https://t.co/4OXcDkyQSk

Warm regards,
Jenny

@edkamrin Hello! I recommend that you contact us by live chat or phone so we can help you further with your questions. Our livechat and phone numbers can be found here: https://t.co/b3QIqPk7bj

Warm regards,
Jenny

@ANDREASJE55EN Hej! Vi ber verkligen om ursäkt för den långa väntetiden till vår kundservice just nu. Du kan antingen köpa en flygbiljett via vår hemsida eller genom att ringa oss. Våra telefonnummer finns att hitta här: https://t.co/b3QIqPk7bj

Med vänliga hälsningar,
Jenny

@PaulKeeper99 Hi, in addition to our live chat, it is also possible to call our telephone support, so that we can look at how we can help you in the best way with your question.

You can find our telephone numbers and opening hours here: https://t.co/b3QIqPk7bj
Kind regards / Sanna

@jmhamilton93 Hi, name change must be performed over the phone with our sales and service support. You can find our phone numbers on https://t.co/b3QIqPk7bj

Best regards,
Anton.
